window.bookSummaryJSON = "<p>Enjoy this spicy contemporary bedtime story from New York Times bestselling author Shayla Black.</p> <p>How far will they go to prove she's theirs forever?</p> <p>I'm Kate. I'm recently divorced and so done with men.</p> <p>Or I was until my boss pairs me with two gorgeous executives who make my blood race. Rumor is, they prefer to do their women one way: together.</p> <p>When a critical project takes us to paradise, I can't resist fantasy anymore. Marcus and Josh prove themselves considerate, attentive, and protective. Did I mention possessive, too?</p> <p>But when the fantasy becomes all too real, will our passion be enough to last?</p> <p>Contains mature themes.</p>"; 
